import React from 'react'

export default function Cards() {
    return (
        <div>
            <div className="card mt-5 mb-5" style={ { "width": "18rem", "maxHeight": "360px" } }>
                <img className="card-img-top" src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.cubesnjuliennes.com%2Fchilli-paneer%2F&psig=AOvVaw1fQWyXcrIrf7D8QamXZfA-&ust=1702663374064000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCIC8xsLBj4MDFQAAAAAdAAAAABAD" alt="Card image cap" />
                <div className="card-body">
                    <h5 className="card-title">Card title</h5>
                    <p className="card-text">Important Text.</p>
                    <div className="container w-100">

                        <select className='m-2 h-100 bg-success rounded'>
                            { Array.from( Array( 6 ), ( e, i ) => {
                                return (
                                    <option key={ i + 1 } value={ i + 1 } > { i + 1 }</option>
                                )
                            } ) }
                        </select>

                        <select className='m-2 h-100 bg-success rounded'>
                            <option value="half">Half</option>
                            <option value="full">Full</option>
                        </select>

                        <div className='d-inline h-100 fs-5'>
                            Total Price
                        </div>

                    </div>
                </div>
            </div>
        </div>
    )
}
